import Card from '../General/CardComponent';
import ExpenseItem from './ExpenseItem';
import '../../styles/Expenses.css';
import ExpenseFilter from './ExpenseFilter'

function Expenses(props) {

    function getFilterYearHandler(selectedYear) {
        console.log('in expense file')
        console.log(selectedYear)

    }

    return (
        <div>
            <Card className="expenses">
                <ExpenseFilter setYear={getFilterYearHandler} />
                {props.expenses.map((expense) => (
                    <ExpenseItem title={expense.title} amount={expense.amount} date={expense.date}></ExpenseItem>
                ))}
            </Card>
        </div>
    );
}

export default Expenses;
